import React, { Component } from "react";
import { StyleSheet, View, Text, Image } from "react-native";

function Home(props) {
  return (
    <View style={styles.container}>
      <Text style={styles.loremIpsum}></Text>
      <Text style={styles.loremIpsum2}></Text>
      <Text style={styles.albalateat}>ALBALATEAT</Text>
      <Image
        source={require("../media/albalat_logo.png")}
        resizeMode="contain"
        style={styles.image}
      ></Image>
      <Grid container component="main" sx={{ height: '100vh' }}></Grid>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "rgba(45,47,158,1)"
  },
  loremIpsum: {
    fontFamily: "roboto-regular",
    color: "#121212",
    marginTop: 92,
    marginLeft: 82
  },
  loremIpsum2: {
    fontFamily: "roboto-regular",
    color: "#121212",
    height: 5,
    width: 1,
    transform: [
      {
        rotate: "90.00deg"
      }
    ],
    marginTop: 20,
    marginLeft: 93
  },
  albalateat: {
    fontFamily: "roboto-700",
    color: "rgba(255,255,255,1)",
    fontSize: 28,
    marginTop: 241,
    marginLeft: 102
  },
  image: {
    width: 200,
    height: 200,
    marginTop: -252,
    alignSelf: "center"
  }
});

export default Home;
